INSERT INTO `manage_notification_mail` VALUES (1,'1','otp','Welcome to {SITE_TITLE}','<p>Hi {USERNAME},</p> <p>Thank you for registration with {SITE_TITLE}</p> <p>OTP for your verification is {OTP}</p>','Active',1,1580286950,1580286950),(2,'1','forget_password','Forgot Password: {SITE_TITLE}','<p>Hi {USERNAME},</p> <p>OTP to set your new password is : {OTP}</p>','Active',1,1580219222,1580219222),(3,'1','sucessfully_registration','Verification: {SITE_TITLE}','Dear {USERNAME}, <p>Thank you for registering with {SITE_TITLE}.</p> <p> Please verify your account by clicking this link {URL}</p> <p></p> <p>Sincerely,<br />VirJual:Digital Showrooms</p> <p>https://www.virjual.com/</p>','Active',0,0,0),(4,'1','admin_forget_password','Forgot Password: {SITE_TITLE}','<p>Hi <strong>{USERNAME}</strong>,</p> <p>To make your account secure, change your password after login with the above details. If you didn&rsquo;t make the request, just ignore the email.<br /> No worry, we got you! Log into your account using the details below.</p>','Active',1,1579787167,1579787167),(5,'1','instructor_register_with_studio','Register with studio','<p>Hi <strong>{OWNERNAME}</strong>,</p> <p>{USERNAME} Register with your studio and OTP is {OTP}</p>','Active',1,1579787167,1579787167),(6,'1','instructor_registration_by_owner','Verification: {SITE_TITLE}','Hi <strong>{USERNAME}</strong>,\r\n<p>A studio you work for has registered your profile with Warrior SMS. Please finish your profile by {URL}. </p> \r\n<p> Your temporary login password is {PASSWORD}</p> \r\n<p></p>\r\n<p>Sincerely,<br />Warrior Signal Health Group Inc.</p>\r\n<p>signalhg.consagous.co.in</p>','Active',0,0,0),(7,'1','welcome_registration','Verification: {SITE_TITLE}','<p>Hi {USERNAME},</p> <p>Thanks for registering on {SITE_TITLE}.</p>','Active',0,0,0),(8,'1','new_client_registration','Login Process: {SITE_TITLE}','<p>Hi {USERNAME},</p> \r\n<p>Thank you for registering with {STUDIO_NAME}. Please complete your account registration with our booking software platform Signal Health Group Inc. by downloading the app from your app store. You can also complete your account by logging in on line as a client here {URL}.</p>\r\n<p> Your login password is {PASSWORD}</p> \r\n<p>Once you have registered you will find details under \"My Studios\" in the main menu.</p>\r\n<p>If you have any questions, please contact us.</p>\r\n<p></p>\r\n<p>{STUDIO_NAME}</p>\r\n<p>https://signalhg.consagous.co.in</p>\r\n','Active',0,0,0),(9,'1','verify_email','Email Verify: {SITE_TITLE}','<p>Hi {USERNAME},</p> <p>Thanks for registering on {SITE_TITLE}.</p><p> Please verify your account by clicking this link {URL}</p> \r\n','Active',0,0,0),(10,'1','alert_retailer_by_user','Alert Retailer: {SITE_TITLE}','<p>Hi {USERNAME},</p> <p>This is test description on {SITE_TITLE}.</p\r\n','Active',0,0,0),(11,'1','alert_admin_product_dimensions_ar','Request for ar model by dimensions: {SITE_TITLE}','<p>Hi {USERNAME},</p> <p>The user {USER_NAME} with email {USER_EMAIL} is requesting for Ar Model By providing following details.<br/>Height : {DIMENSION_HEIGHT}<br/>Width : {DIMENSION_WIDTH}<br/>Length : {DIMENSION_LENGTH}<br/>Photo : {PHOTO_URL}</p>','Active',0,0,0);
